/* eslint-disable no-useless-constructor */
import React from 'react';
import ReactDOM from 'react-dom';

class App extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return <div>
      hello zhangyuyong App
    </div>
  }

}
const element = <App />
console.log("element", element)

ReactDOM.render(
  <element />,
  document.getElementById('root')
);
